import React from 'react';

export default function Navbar() {
	return (
		<div className='navbar'>
			<div className='main-navbar'>
				<h1>Logo</h1>
			</div>
			<div className='secondary-navbar'>
				<span>second</span>
			</div>
		</div>
	);
}
